import request from '@/utils/request';
import { host } from "./utils";
export function createTeam(data) {
  return request({
    url: host + '/api/team/add',
    method: 'post',
    data: data
  });
}
export function getTeamList(params) {
  return request({
    url: host + '/api/team/list',
    method: 'get',
    params: params
  });
}
export function getTeamIndexList(params) {
  return request({
    url: host + '/api/team/index_list',
    method: 'get',
    params: params
  });
}
export function getTeamPage(page, params) {
  return request({
    url: host + '/api/team/page/' + page,
    method: 'get',
    params: params
  });
}
export function getTeam(params) {
  return request({
    url: host + '/api/team/get',
    method: 'get',
    params: params
  });
}
export function getInfo(params) {
  return request({
    url: host + '/api/team/info',
    method: 'get',
    params: params
  });
}
export function deleteTeam(params) {
  return request({
    url: host + '/api/team/delete',
    method: 'get',
    params: params
  });
}
